            This letter is to provide you notice pursuant to 17 U.S.C. § 512
(c)(3)(A) of unauthorized use of copyrighted material of Alpine
Electronics of America, Inc. ("Alpine") (such copyrighted material is
referred to as "Alpine Works") by your client, woofersetc.com, at the
URL woofersetc.com.  Alpine has a good faith belief that use of the
Infringing Material by your client is not authorized by Alpine, its
agents, or the law, and the information contained in this letter is
accurate.   
 
  
 
            The specific works, graphics or other material Alpine believes to be
infringed or to be the subject of infringing activity (the "Infringing
Material") are copyrighted images from Alpine's website.  Specific
violations of copyrighted images by woofersetc.com. are listed below
this paragraph. 
 
  
 
http://www.woofersetc.com/index.cfm?fuseaction=product.display&Product_ID=2459 
 
http://www.woofersetc.com/index.cfm?fuseaction=product.display&Product_ID=4192 
 
