http://www.woofersetc.com/index.cfm?fuseaction=product.display&Product_ID=2462 
 
  
 
      There are various additional locations of infringement on woofersetc.com
website.  The above list is a specific sample of some of these, but all
infringements need to be addressed. 
 
  
 
            Therefore, pursuant to the requirements of 17 U.S.C. § 512(c)(1)(C),
Alpine hereby demands that you remove or disable access to the
Infringing Material in an expeditious manner.   
 
  
 
If you have questions, please contact Net Enforcers Compliance Management Department
via facsimile to 501-646-6242, or via email to
Compliance.Management@NetEnforcers.com.  All communication must be in writing, but
if you need to contact Net Enforcers directly, you can contact them at 501-646-6242.
Net Enforcers is authorized to handle and resolve this matter with you and has
already been involved with this case.  Calls directly to Alpine will not be
accepted.  If your designated agent or representation does not respond to this
demand as requested by 5:00 p.m. on 8/19/2006, we will assume that this demand has
been rejected and proceed accordingly. 
 
  
 
Sincerely, 
 
Ellis & Venable 
 
  
 
